Durante il lungo cammino scolastico, per evitare che la noia prenda il sopravvento, due ragazzi si divertono ad associare i membri della classe a delle squadre di Serie A.

Vedendo che l'idea piace a molti, crearono anche una classifica, basandosi sui risultati ottenuti in verifica.

Stilata a scontri diretti uguali a quelli della Serie A, voti maggiori andranno a incrementare il numero di gol fatti in questo ordine:

Voto < 6: 0 Gol;

6 < Voto < 6.75: 1 Gol;

7 < Voto < 7.75: 2 Gol;

8 < Voto < 8.75: 3 Gol;

9 < Voto < 9.75: 4 Gol;

Voto=10: 5 Gol.
